# lmhedin_se.notes
-
  id: 26
  head: "Balken p plats"
  date: "2009-09-12"
  note: "Hela gnget var hr och hjlpte till att resa upp den stora balken. En hel dags jobb med frberedelser och sedan en hel dag till fr att f allt p plats. Precis innan det blev mrkt p sndagen fick vi den till slut p plats."
  projekt: 0
-
  id: 27
  head: "Garderober i sovrummet"
  date: "2009-01-07"
  note: "P grund av det kalla vdret med minusgrader s bestmde vi oss fr att vnta till vren med att mura kllarvggen fr utbyggnaden. Eller iallafall tills det blir varmare.\r\n\r\nUnder tiden har vi passat p att bygga garderober i sovrummet p ovanvningen. Brjade med att riva vggen ut mot gatan dr det sedan tidigare var ett utrymme. Rivningen gick mycket fort och smidigt. Efter att ha tittat p fiverse frdiga garderober och jmfrt priser bestmde vi oss fr att bygga sjlva.\r\n\r\nMaterial kptes till strsta delen p ByggMax men ven Hornbach fick st fr ngra spnskivor. Dock kunde vi konstatera att ByggMaxs spnskivor kndes hrdare och bttre.\r\n\r\nGarderobern, 1st enkel och 3st dubbel, byggdes s att IKEAs inredning skulle passa vilket den tillslut ocks gjorde. Resultatet blev sjukt bra och vi r mycket njda, trots att vi nu r en hammare fattigare."
  projekt: 0
-
  id: 28
  head: "Det brjar bli tomt runt huset"
  date: "2008-06-08"
  note: "Strlande vder. > 20 grader och molnfritt. Linda flyttade uteplatsen ut mellan trden och stllde upp utemblerna. Magnus ledsnade p rododendron och kapade av den istllet fr att grva upp den. Det  brjar bli tomt runt huset. "
  projekt: 0
-
  id: 29
  head: "V-Kort"
  date: "2008-06-13"
  note: "Fint vder men lite svalare n tidigare. Hyrde krra p Preem och slngde massor med ris och annat brte p tervinningsstationen. Fick vrat terVinnings-kort."
  projekt: 0
-
  id: 30
  head: "Grva fr hand?"
  date: "2008-07-08"
  note: "Perfekt vder fr att grva, inte fr varmt och inte fr kallt (moln och 17 grader). Har kollat vad en minigrvare skulle kunna tnkas kosta. Snabbt verslag s gissar vi p 5000-6000kr fr en helg. Mycket pengar tnker vi och blir sugna p att frska grva fr hand... To Be Continued.\r\n\r\nMC-parkeringen nedtagen och uppbyggd igen bakom friggeboden."
  projekt: 0
-
  id: 31
  head: "Isoliering 45mm"
  date: "2009-10-06"
  note: "Isolerade insidan av utbyggnaden p bottenvningen med 45mm isolering. Gick ganska fort och vi tyckte oss knna skillnad omgende. Kan dock ha varit placebo.\r\n\r\nUnderlagspappen som vi har lagt blser bort hela tiden s det har runnit in vatten frn vinden. Detta har medfrt att vi nu har en hel drs med svarta flckar i sovrumstaket. Bara att skrapa och mla igen, inga problem. Men trkigt."
  projekt: 0
-
  id: 32
  head: "Huset p avstnd"
  date: "2009-10-06"
  note: "Gick upp p utsiktsplatsen och fotade utbyggnaden p avstnd. Inte jttebra bilder kanske men lite roligt."
  projekt: 0
-
  id: 33
  head: "Drnering, dagen innan"
  date: "2008-07-18"
  note: "Fick maskinen vid 14-tiden. Christian kom vid 18 och vi grvde ngra timmar. Hmtade en avundsjuk Linda frn After Work vid 21 :)"
  projekt: 0
-
  id: 34
  head: "Stora-grvardagen"
  date: "2008-07-19"
  note: "Har grvt framsidan och sydsidan. Upptckte en vldigt stor bottenplatta. Grvde av telefonledningen. Avslutade dagen med en regnskur och grillad kyckling. Nrvarnde, frutom husets gare, utan inbrdes ordning: Mona, Christian, Fredrik, Olof, Louise, Charlotte och David. Imorgon brjar vi grva tidigare."
  projekt: 0
-
  id: 35
  head: "Bllera"
  date: "2008-07-20"
  note: "Grvde vstsidan av huset. Massor av vldigt blt lera, ju lngre ner vi kommer ju blare blir den. Leran visade sig ocks vara \"bottenls\" d det gr att f ner ett spett, utan problem, utan att hitta fast botten. Hela tomten r full av jord och lera i stora hgar. Charlotte trillade ner i hlet."
  projekt: 0
-
  id: 36
  head: "Nordsidan"
  date: "2008-07-21"
  note: "Grvardag 3, gick an p norrsidan och hittade plar och en backe p bottenplattan. Linda fick en lerklump i baken och platsen tog slut p tomten. Vran tomt bestr nu av ett gigantiskt hl och mnga vldigt stora ler/jord hgar.\r\n\r\nDet tog drygt tv timmar att sanera maskinen frn all lera. Linda anvnde spade fr att f ut all lera frn huset. Anvnder nu grannens tomt fr att f ut MCn frn friggeboden till gatan. Bilen str parkerad p gatan lgnre bort.\r\n\r\nJust nu intalar vi oss sjlva att det hr r den jobbigste och mest krvande delen av renoveringen."
  projekt: 0
-
  id: 37
  head: "Bort med leran"
  date: "2008-07-26"
  note: "Frbereder fr att flytta bort delar av jordmassorna som ligger utspridda p hela tomten. Har planat ut marken dr plattan till utbyggnaden skall vara. Jobbar med att f bort alla gamla drneringsrr och grva ut fr dom nya.\r\n\r\nPlockade upp plastmatten under trappen i kllaren. Det visade sig vara ett lager av kra ovanp cementen som ocks mste bort. Varfr kan ingenting bara vara enkelt :)"
  projekt: 0
-
  id: 38
  head: "Lite lera borta"
  date: "2008-07-28"
  note: "Hyrde hjullastare frn Allt i Mark och container frn Allfrakt. Krde sammanlagt cirka 35 kubikmeter lera och jord hrifrn. Rensade garageuppfarten s nu har vi ntligen plats fr andra saker p tomten ocks. Tnker lna pappas bil och slpkrra och ka och kpa drneringsmaterial i veckan."
  projekt: 0
-
  id: 39
  head: "Brjat drnera"
  date: "2008-09-20"
  note: "Har lagt ner drneringsrr och dagvattenrr p norrsidan. Fyllt igen och lagt plattor frbi trappan till kllaren. Planen nu r att drnera sidorna p huset frst och gra utbyggnaden sedan.\r\n\r\nVi har nu ven slt Aygon och skaffat oss en Ford Focus, men saknar Augon lite nd. Knns otroligt bra att ha en bil som gr att anvnda till att kpa grejer till huset med iallafall. Pappas krra str nu hr permanent :)"
  projekt: 0
-
  id: 40
  head: "Plattor"
  date: "2008-09-27"
  note: "Var p Hornbach och kpte en ny skottkrra. Kpte reglar och byggde form till garageuppfarts-plattor. Spolade av grundplattan och frberedde fr att gjuta fall."
  projekt: 0
-
  id: 41
  head: "Gjutit fall"
  date: "2008-09-28"
  note: "Gjutit fall. Tog tv timmar, gick ver frvntan. Linda hann med att stda kllaren vilket var mer n behvligt. Magnus pbrjade projektet \"ta bort oljetanken\".\r\n\r\nGt frsta provplattan till uppfarten och givetvis s hade vi fgelfotavtryck efter en kort stund. => Gjuta inomhus is da shit!"
  projekt: 0
-
  id: 42
  head: "12 ton makadam"
  date: "2008-10-03"
  note: "12 ton makadam kom idag em frn vikans kross. Plattorna p uppfarten ville inte riktigt hlla upp lastbilen, grushgen hamnade lite lngre ut n planerat men fortfarande p tomten. Vi pbrjade rengring av norr-vggen och brjade ven lgga ner drneringsrren p den samma."
  projekt: 0
-
  id: 43
  head: "Drneringsarbete"
  date: "2008-10-11"
  note: "Ett ste-styrka pass p Friskiis & Svettis fljt av en dag med ler-grvande resulterade i en trningsverk icket av denna vrld (fr Linda).\r\n\r\nChristian och Olof hjlpte till idag. Vi grvde ner rren lngs hela framsidan, frn hrnet till brunnen. Lyckades ven hinna med att f dit pordrnplattorna halva vgen fram."
  projekt: 0
-
  id: 44
  head: "Rengring av vggen"
  date: "2008-10-12"
  note: "Rengjorde resten av vggen med maskin hyrd frn Cramo. Satte plattor resten av vgen p vggen fram till brunnen. Listen r spikad och en lg mur av lera r p plats. 12 tons hgen med makadam har nu synliga spr av \"nallande\". Har ven brjat flytta lera frn platsen fr tillbyggnaden."
  projekt: 0
-
  id: 45
  head: "Mer makadam"
  date: "2008-12-07"
  note: "Jo, nu har vi kommit mycket lngre. 12 tons hgen med makadam r slut och en ny 13,7 tons hg r halverad. La klart drneringsrren runt tillbyggnaden idag. Nu r rren ihopkopplade runt hela huset, snr som p den sista lilla biten framfr trappan.\r\n"
  projekt: 0
-
  id: 46
  head: "Gjutit platta fr utbyggnad"
  date: "2008-11-16"
  note: "Gjutning av plattan gick mycket bra. Christian, Mona, Olof, Fredrik, Linnea, Linda och Magnus hjlptes t med att blanda, tmma, bra och platta ut cementen. Knns nsta overkligt bra nr man tittar p det.\r\n\r\nPlanen r att brja myra vggen till utbyggnaden innan jul. Sedan r det terfyllnad kvar vilket vi tnker gra med maskin. Men redan nu kan det rasa hur mycket som helst (nstan) utan att det frstr fr oss, ntligen. SKNT!"
  projekt: 0
-
  id: 47
  head: "Utbyggnad till tippen"
  date: "2009-08-30"
  note: "Tre vndor till V-centralen fr att slnga gamla utbyggnaden. Byggt regnskydd till kllaren och satt upp plast p innervggen s det inte blser in. Brjar g mot hst nu."
  projekt: 0
-
  id: 48
  head: "Papp p taket"
  date: "2009-10-01"
  note: "Fredrik var hr en dag mitt i veckan och vi brjade lgg underlagspapp. Brjade med gamla delen av huset eftersom den r ott och lcker in. Skall fortstta i helgen."
  projekt: 0
-
  id: 49
  head: "Mer papp och vindskivor"
  date: "2009-10-04"
  note: "Har nu lagt underlagspapp p hela baksidan av huset. Bde nya och gamla delen. Brjade och kom ganska lngt med att tcka utbyggnaden med vindskivor. Planen r att f upp dom sista utegips skivorna p mndag eftermiddag s det slutar blsa inomhus."
  projekt: 0
-
  id: 50
  head: "Takstolar och brjan till tak"
  date: "2009-09-27"
  note: "D var det dax att f p takstolar p utbyggnaden. Krvdes en hel del tankeverksamhet fr att f ihop det hela med gamla delen av huset. Brjade med att bygga undre delen av takstolarna och kl den med tak. Kndes skrare att ha det s nr vi satte dit vre spetsen av takstolen.\r\n\r\nNu har utbyggnaden ftt sin slutgiltiga form. Fattas bara tak, panel och fnster... men konturerna r dr. Ser mycket bra ut och det passar verkligen ihop med den gamla delen av huset."
  projekt: 0
-
  id: 51
  head: "Undergolv p plats i utbyggnad"
  date: "2009-10-25"
  note: "Har lagt undergolv i utbyggnaden i helgen. Tog en dag per vning ungefr. Det var ganska mycket jobb med att f alla reglar och frstrkningar p plats mellan golvbjlkarna.\r\n\r\nDessutom har vi ftt all isolering p plasts i utbyggnaden. Saknas lite smbitar bara men det fixar vi nr det r dax att stta in fnstren."
  projekt: 0
-
  id: 52
  head: "Bort med kllarvggen"
  date: "2009-10-27"
  note: "ntligen r vggen i kllaren borta. Gick ver frvntan, Christian och Fredrik var hr och krde med Ingemars monstermaskin. Passade p att kra ivg allt vi rev ner till soptippen ocks s det knns otroligt sknt. ntligen har vi ftt ett tillflligt frrd."
  projekt: 0
-
  id: 53
  head: "Ut med oljetanken"
  date: "2008-12-17"
  note: "Efter att ha trttnat p att ha det s \"kligt\" i tvttstugan har vi bestmt oss fr att gra ngot t det. Det var ungefr 150 liter olja kvar som vi fick pumpa ut och ka till V-centralen med, inga problem det r gratis nr det r miljfarligt avfall. Fyllde ca 20 cm med sand i tanken och brjade skra med vinkelslipen. Den orkade inte och gav upp, lyckades dock reklamera den och passade ven p att kpa en sticksg som var betydligt mer lmpad fr uppgiften. Allt bra nu terstr att slnga delarna p tippen."
  projekt: 0
-
  id: 54
  head: "Mlat tvttstugan"
  date: "2008-12-19"
  note: "Nu har vi lyckats kladda frg p vggarna ocks. Vilken skillnad det blev. Vi valde en vldigt ljus gr nyans fr att f det ljust men inte lysande vitt."
  projekt: 0
-
  id: 55
  head: "Taket har kommit"
  date: "2009-11-08"
  note: "Var och hmtade taket p Hornbach. En helpall med shingel."
  projekt: 0
-
  id: 56
  head: "Putsat insidan p kllarvggen"
  date: "2009-11-07"
  note: "Putsade insidan p kllarvggen, tog vl halva dagen ungefr."
  projekt: 0
-
  id: 57
  head: "Nu r ven drrarna p plats"
  date: "2009-04-01"
  note: "Handtag och drrar p plats, s hr ser det ut nu."
  projekt: 0
-
  id: 58
  head: "Brjan p nytt sovrum"
  date: "2009-02-27"
  note: "Brjat riva ner vggar och tapeter."
  projekt: 0
-
  id: 59
  head: "Vggarna nere"
  date: "2009-02-28"
  note: "Vggar, tapet och gammalt skivmaterial p vggarna r borta. Dax att slipa golvet."
  projekt: 0
-
  id: 60
  head: "Slipning"
  date: "2009-03-01"
  note: "Slipningen gr ganska bra. Fick dock brja med att laga slipmaskinen som vi hyrt p Bauhaus. Fick dessutom ka och kpa grvre sandpapper eftersom den gamla lacken stter igen sanpappret med en gng. Snart klart!"
  projekt: 0
-
  id: 61
  head: "Klar med slipningen"
  date: "2009-03-04"
  note: "Nu r det slipat. Helt sjukt vilken skillnad det blev. Vi r mycket njda, givetvis."
  projekt: 0
-
  id: 62
  head: "Golvbehandling"
  date: "2009-03-06"
  note: "Vi har bestmt oss fr att luta golvet och sedan spa det. terstr och se hur det blir nr det har torkat."
  projekt: 0
-
  id: 63
  head: "Fixa runt fnstret"
  date: "2009-03-08"
  note: "Planken under fnstret var dlig och behvde bytas. Sgade ut allt dligt med tigersgen och snickrade dit nytt fint virke frn innervggen som vi rev tidigare.\r\n\r\nTtade med fogskum runt fnstret ocks s nu har vi lrt oss hur man inte skall gra. Det vxer ngot helt enormt nr det torkar."
  projekt: 0
-
  id: 64
  head: "Vindskivor p plats"
  date: "2009-12-13"
  note: "Tog hela helgen att f dit vindskivorna. Vi hade hyrt stllning och Christian var hr. Segt arbete med mycket spring upp och ner. Mycket jobb med att fixa till all papp som hade blst snder. Linda plockade eternit frn marken hela helgen men det r fortfarande mycket kvar att samla ihop s vi kan ka till tippen med det."
  projekt: 0
-
  id: 65
  head: "Papp p hela taket"
  date: "2009-12-06"
  note: "ntligen har vi papp p hela taket. Som vanligt jobbade vi hela helgen. Plockade bort eternit och gammal papp p framsidan av huset och ersatte med ny fin papp. Vi fick ven hjlp med att riva tapet i kllaren."
  projekt: 0
-
  id: 66
  head: "Hyllor i Linneas rum"
  date: "2009-11-14"
  note: "Har satt upp lite hyllor och kldhngare i nya rummet i kllaren (aka. Linneas rum)\r\n\r\nSknt att kunna bra in alla verktyg och annat brte som har legat ver allt i hela huset."
  projekt: 0
-
  id: 67
  head: "Vgg i sovrummet"
  date: "2009-03-12"
  note: "Reglat upp vggen som skall vara mellan sovrummet och toaletten. Har kommit sn :)"
  projekt: 0
-
  id: 68
  head: "Vggbekldnad"
  date: "2009-03-13"
  note: "Jobbet med sovrummet gr vidare. Nu har vi isolerat taget/vggen och har alla OSB-skivor p plats. Brjar f en knsla fr hur det kommer bil nu med den nya vggen."
  projekt: 0
-
  id: 69
  head: "Gips"
  date: "2009-03-19"
  note: "Nu r gipsen p plats. Knns som ett rum nu, lngtar tills vi fr tapet p vggarna."
  projekt: 0
-
  id: 70
  head: "Spackling"
  date: "2009-03-22"
  note: "Skarvarna r spacklade och vi vntar nu p att det skall torka s vi kan slipa och tcka av golvet."
  projekt: 0
-
  id: 71
  head: "slipat och stdat"
  date: "2009-03-29"
  note: "Nu har vi slipat och stdat sovrummet. Stllde in sngen ocks fr att f se hur stor plats den tar. Rummet knns betydligt strre n vad vi hade frvntat oss. Bra med plats vid sidan om sngen och ett dansgolv mellan sngen och garderoberna :)"
  projekt: 0
-
  id: 72
  head: "Tapetsering"
  date: "2009-04-10"
  note: "Sknt att ha ftt p tapeten p vggarna. Lite pill med konstiga vinklar mellan vgg och snedtaket, men vi lyckades f till det riktigt bra."
  projekt: 0
-
  id: 73
  head: "Rivning av gamla garderoben"
  date: "2009-04-26"
  note: "Fick hjlp med att riva den gamla garderoben och vggen frn datorrummet in till dr toaletten senare skall vara. Har tyvrr inga bilder p hur det blev men det kommer vl senare."
  projekt: 0
-
  id: 79
  head: "Kpte frsta omgngen med panel"
  date: "2009-12-27"
  note: "Kpte s mycket panel och spiklckt krran klar. 23 plankor blev det, terstr att se hur lngt det rcker. Antagligen behver vi tminstone 3 sdana vndor till."
  projekt: 0
-
  id: 78
  head: "Hmtade gratis fnster"
  date: "2009-12-27"
  note: "Hittade fnster p blocket som garen vill bli av med. Nstan samma storlek som dom vi har. Dessutom s fanns dom en knapp kilometer hrifrn. Bara att ka och hmta"
  projekt: 0
-
  id: 80
  head: "Mlade panel"
  date: "2009-12-28"
  note: "Brjat mla panel. Hnger p tork i kllaren p vran nya, patentskta, torkstllning som Oskar och Linda har byggt alldeles sjlva."
  projekt: 0
-
  id: 81
  head: "Spikade upp panel"
  date: "2009-12-29"
  note: "Har spikat upp bottenplankorna till panelen. Saknas locklister och hrnplankor som kommer senare. Vi vet fortfarande inte var vi skall f tag p locklisterna."
  projekt: 0
-
  id: 82
  head: "Uttag fr fnster i utbyggnaden"
  date: "2009-12-30"
  note: "Innan vi stter panel p baksidan tnkte vi mrka ut var fnstren skall sitta. Har nu gjort avlastningar i vggen fr dr fnstren skall sitta. Antagligen r det ondigt mycket frstrkningar med hellre det."
  projekt: 0
-
  id: 83
  head: "Dator i kket"
  date: "2009-12-31"
  note: "Alla har vl dator i kket?"
  projekt: 0
-
  id: 84
